import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { userRequest } from "../../Utils/requestMethods";
import { useDispatch, useSelector } from "react-redux";
import { authActions } from "../../Redux/authRedux";
import { toast } from "react-toastify";

const EditProfile = () => {
  const dispatch = useDispatch();
  const authUserId = localStorage.getItem("userId");
  const token = localStorage.getItem("token");

  const [loading, setLoading] = useState(false);
  const [firstname, setFirstname] = useState("");
  const [surname, setSurname] = useState("");
  const [phone, setPhone] = useState("");
  const [email, setEmail] = useState("");
  const [img, setImg] = useState("");
  const [file, setFile] = useState(null);

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const res = await userRequest.get("users/profile");
        const data = res.data;
        setFirstname(data.firstname || "");
        setSurname(data.surname || "");
        setPhone(data.phone || "");
        setEmail(data.email || "");
        setImg(data.img || "");
      } catch (err) {
        console.error(err);
        toast.error("Failed to load profile");
      }
    };
    fetchProfile();
  }, []);

  const uploadFile = async (fileToUpload) => {
    const formData = new FormData();
    formData.append("file", fileToUpload);
    try {
      const res = await userRequest.post("upload", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      return res.data.url;
    } catch (err) {
      console.error(err);
      toast.error("Image upload failed");
      return null;
    }
  };

  const submitHandler = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      let uploadedUrl = img;
      if (file) {
        const url = await uploadFile(file);
        if (url) uploadedUrl = url;
      }

      const payload = {
        firstname,
        surname,
        phone,
        img: uploadedUrl,
      };

      const res = await userRequest.put("users/profile", payload);
      const updated = res.data;
      // refresh auth redux state so navbar updates
      dispatch(
        authActions.login({
          token: token,
          userId: authUserId,
          isAdmin: updated.isAdmin,
          name: `${updated.firstname} ${updated.surname}`,
          img: updated.img,
          phone: updated.phone,
          email: updated.email,
          maker: updated.maker,
          type: updated.type,
          license: updated.license,
        })
      );

      toast.success("Profile updated");
    } catch (err) {
      console.error(err);
      toast.error(err?.response?.data?.error || "Failed to update profile");
    } finally {
      setLoading(false);
    }
  };

  return (
    <FormCard onSubmit={submitHandler}>
      <h3>Edit Profile</h3>
      <Label>First name</Label>
      <Input value={firstname} onChange={(e) => setFirstname(e.target.value)} />

      <Label>Last name</Label>
      <Input value={surname} onChange={(e) => setSurname(e.target.value)} />

      <Label>Phone</Label>
      <Input value={phone} onChange={(e) => setPhone(e.target.value)} />

      <Label>Email (readonly)</Label>
      <Input value={email} readOnly />

      <Label>Profile Image</Label>
      <Input type="file" onChange={(e) => setFile(e.target.files[0])} />
      {img && <Preview src={img} alt="profile" />}

      <Button type="submit" disabled={loading}>
        {loading ? "Saving..." : "Save Changes"}
      </Button>
    </FormCard>
  );
};

export default EditProfile;

const FormCard = styled.form`
  width: 100%;
  max-width: 720px;
  background: white;
  padding: 1rem 1.4rem;
  border-radius: 12px;
  box-shadow: 0 6px 18px rgba(0,0,0,0.08);
  margin-bottom: 1rem;
`;

const Label = styled.label`
  display:block;
  margin-top:0.6rem;
  font-weight:600;
`;

const Input = styled.input`
  width:100%;
  padding:0.6rem;
  border-radius:8px;
  border:1px solid #ddd;
  margin-top:0.3rem;
`;

const Button = styled.button`
  margin-top:1rem;
  padding:0.75rem 1rem;
  background:#d62828;
  color:white;
  border:none;
  border-radius:8px;
  cursor:pointer;
`;

const Preview = styled.img`
  margin-top:0.6rem;
  width:80px;
  height:80px;
  object-fit:cover;
  border-radius:50%;
`;
